import axios from "axios";

const apiKey = "a8ce1029e7856b8a14e6b172318a0f31";

export const pochtaTest = async () => {
  try {
    const response = await axios.get("https://api.novaposhta.ua/v2.0/json/", {
      apiKey: "a8ce1029e7856b8a14e6b172318a0f31",
      modelName: "Address",
      calledMethod: "getSettlementAreas",
      methodProperties: {
        Ref: "",
      },
    });
    console.log(response);
    return response.data;
  } catch (error) {
    console.error("Error fetching data:", error);
  }
};
